description:
Justice League: Crisis on Two Earths (2010)  

Verenigde Staten
Animatie
72 minuten

geregisseerd door Sam Liu en Lauren Montgomery
met de stemmen van Mark Harmon, Alyssa Milano en James Woods

Een heldhaftige versie van Lex Luthor (Chris Noth) uit een ander universum vraagt de Justice League om hulp om zijn Aarde te redden van de Crime Syndicate; een kwaadaardige versie van de Justice League. Wat volgt is een strijd tussen goed en kwaad, die beide planeten in gevaar brengt.


Vertaald door Fast-Release team:
Dejavu, Gonnie, Sendleech,
BlackWidow en Chenoa
